import React from 'react';
import dino from '../newDino.png';
import tree from '../tree.png';

import {Image} from "@microsoft/fast-components-react-msft";
import { Grid, Column} from "@microsoft/fast-layouts-react";
import { AnimateTo, AnimateGroup } from "@microsoft/fast-animation";
// import { AnimateSequence} from "@microsoft/fast-animation";



  export class AnimateDino extends React.Component {
    render(){
      return (
        <Grid id="animationGrid">

                <Column id="dinoColumn"
                  span={4}
                  position={1}
                >
                  <Image
                    id="dino"
                    src={dino}
                    alt="dino"
                  />
                </Column>

                <Column
                span={1}
                position={9}
                >
                  <Image
                    id="tree1"
                    src={tree}
                    alt="tropical tree"
                  />
                </Column>

                <Column 
                span={2}
                position={10}
                >
                  <Image
                    id="tree2"
                    src={tree}
                    alt="tropical tree"
                  />
                </Column>

                <Column 
                  span={1}
                  position={12}
                >
                  <Image
                    id="tree3"
                    src={tree}
                    alt="tropical tree"
                  />
                </Column>

              </Grid>
      )
    }
  }
